gTi(){return"About the GuideAut"},
gTh(){return"Guideaut is the result of a series of scientific works developed by students of computing courses at the University of the State of Amazonas (UEA).\nAll of its features were designed to meet the entire ProAut process, which is a specific process for developing application interfaces aimed at the autistic public. \nThis process was also the result of extensive research by Prof. Dr. Aurea Melo."},
