gXI(){return"Question 3: Depending on the number of respondents, create an interval with the different series obtained. For example: in the item attending school, if the majority is yes, put the grade interval on the canvas. For example, if a child attends the 3rd, another 4th and another 5th of elementary school, then on the canvas you should put from 3rd to 5th grade of elementary school. If the majority does not attend school, insert \u201cdoes not attend school\u201d on the canvas;"},
gXK(){return"Question 4: take the different answers and check the one that appears the most. For example, if 2 children live with their parents, 1 with their mother and 1 with their grandmother, transcribe \u201clives with their parents\u201d onto Canvas, as it represents the majority;"},
