gZn(){return"Ap\xf3s a fabrica\xe7\xe3o, o prot\xf3tipo \xe9 avaliado. Para tanto, a equipe poder\xe1 utilizar t\xe9cnicas j\xe1 consolidadas na \xe1rea de Engenharia de Software. No entanto, sugere alguns itens a serem observados em rela\xe7\xe3o ao usu\xe1rio. Por exemplo, verifique quem ser\xe1 o usu\xe1rio principal do aplicativo. Se o especialista ser\xe3o os pais ou o autista. Dependendo de quem ser\xe1 o usu\xe1rio principal, t\xe9cnicas tradicionais devem ser observadas para cada tipo de usu\xe1rio. Se voc\xea \xe9 autista, procure, por exemplo, no GuideAut algumas sugest\xf5es para a realiza\xe7\xe3o da avalia\xe7\xe3o."},
gZo(){return"Ao final desta etapa, a equipe deve considerar e avaliar todas as sugest\xf5es de melhoria, refinar o prot\xf3tipo e reavaliar at\xe9 que esteja em uma vers\xe3o satisfat\xf3ria. Em seguida, o prot\xf3tipo poder\xe1 estar dispon\xedvel para o desenvolvimento da aplica\xe7\xe3o em si."},
gTB(){return"A fase de An\xe1lise caracteriza-se pela abordagem do problema, em que a equipa mergulha em toda a informa\xe7\xe3o obtida na fase anterior, avalia as implica\xe7\xf5es do desafio do ponto de vista dos v\xe1rios stakeholders e inicia as principais propostas de solu\xe7\xe3o."},
gTM(){return"\xc9 composto basicamente por 3 atividades: Dados Triangulares, Gerar Mapa de Empatia e Gerar Personas. Ressaltando que os dois \xfaltimos possuem o mesmo objetivo, que \xe9 a gera\xe7\xe3o de empatia entre o designer e o autista. Por\xe9m, no ProAut, o designer pode escolher aquele que mais se identifica com ele ou os dois, se preferir, j\xe1 que geralmente s\xe3o usados de forma complementar. A Figura 12 apresenta a vis\xe3o geral desta fase."},
